import React from 'react';
import './sidebar.scss';
import profileImage from '../../assets/images/profile-image.png';


const Sidebar = () => {
    return(
        <div className="sidebar">
            <div className="sidebar__user">
                <div className="sidebar__user-profile">
                    <img alt="" src={profileImage}></img>
                </div>
                <div className="sidebar__user-info">
                    <p className="sidebar__user-info-name">Pasha Life</p>
                    <p className="sidebar__user-info-email">Pashalife@mail.com</p>
                </div>
            </div>

            <div className="sidebar__nav">
                <ul>
                    <li><a href="#1"><span className="nav-icon dashboard-icon"></span> Dashboard</a></li>
                    <li><a href="#2"><span className="nav-icon tasks-icon"></span> Tasks</a></li>
                    <li><a href="#3">Email</a></li>
                    <li><a href="#4">Contacts</a></li>
                    <li><a href="#5">Chat</a></li>
                    <li><a href="#6">Deals</a></li>
                </ul>
            </div>
        </div>
    ); 
}

export default Sidebar;
